class LevelSystem():
    def __init__(self, name, levels):
        self.name = name
        self.levels = levels

    def findCharacter(self, character):
        for levelName, levelValues in self.levels.items():
            idx = levelValues.find(character)
            if idx != -1:
                return (levelName, idx)
        return (None, None)


